import { GET_PROJECTS, PROJECTS_ERROR } from "../actions/projects";

const initialState = {
  projects: [],
  loading: true,
  errorMsg: null,
};

export default function (state = initialState, action) {
  const { type, payload } = action;

  switch (type) {
    case GET_PROJECTS:
      return {
        ...state,
        projects: payload,
      };
    case PROJECTS_ERROR:
      return {
        ...state,
        errorMsg: payload,
      };
    default:
      return state;
  }
}
